import React, { Component } from 'react';
import './Panel.css';

export default class Panel extends Component {
    constructor() {
        super();
        this.state = {
        };
    }

    render() {
        return (
            <div className="panel-wrap">

                <div className="panel-border"></div>

                    <div className="panels">
                    <div className="panel-one">
                        <div className="panel-one-side"></div>
                        <div className="panel-one-main"></div>
                    </div>
                    <div className="panel-two">
                        <div className="panel-two-side"></div>
                        <div className="panel-two-main"></div>
                    </div>
                    <div className="panel-three">
                        <div className="panel-three-side"></div>
                        <div className="panel-three-main"></div>
                    </div>
                    <div className="panel-four">
                        <div className="panel-four-side"></div>
                        <div className="panel-four-main"></div>
                    </div>

                    <div className="panel-five">
                        <div className="panel-five-side"></div>
                        <div className="panel-five-main"></div>
                    </div>
                </div>
            </div>

        );
    }}
